  03> WILLIAMS, Fraser Andrew
  b 01.03.1996
  Fraser b. at Auckland.
  02> WILLIAMS, Geoffrey Martyn
  b 08.09.1966
  Geoffrey b. at Gisborne. Address: University Chemical Lab, Lendsfield Road, Cambridge CB2 IEW,
  England.
  Geoffrey received his early education at Whatatutu School (Dux 1977). He then attended Edmond
  Campion College, Gisborne, and Wanganui Collegiate School (Grey, 1980-84). In 1988 he graduated
  BSc (Hons) in Chemistry from Massey University and, on being granted a Vice-chancellor's Study
  Award, continued with postgraduate study at Massey. In 1988 he was awarded a scholarship from the
  Australian National University which enabled him to undertake research there for a short period.
  In 1990 he received a Royal Society (NZ) Young Scientist's Award for travel in Australia. In
  January 1992 he completed a Doctorate of Philosophy in chemistry and has since accepted a
  postdoctoral fellowship to undertake research in the Organic Chemistry Department at the University
  of Zurich, Switzerland.
  Geoffrey is a member of the New Zealand Institute of Chemistry and has published a number of papers
  in various international chemistry journals.
  During his time at Massey Geoffrey was faculty representative to the Doctoral Research Committee
  and chairman of the Chess Club. He completed the silver grade of the New Zealand Federation of
  Dance Teachers and took an active interest in road cycling and tramping.
  03> WILLIAMS, Jennifer Robyn.
  b 15.09.1967
  Jennifer b. at Gisborne. Address: C/- ASB Bank Auckland Branch, PO Box 35, Auckland 1015.
  Jennifer attended Iona College from 1981 to 1984. During 1985-89 she was employed by the Westpac
  Banking Corporation. In 1990 she undertook training at the Joyce Blok School of Beauty Therapy and
  Electrology, Auckland and qualified as a therapist. She then established a clinic associated with
  La Rouge Perfumery in Rotorua. She left Rotorua in 1992 and travelled overseas for a year. She is
  now an account manager with ASB Bank in Auckland.
  02> WILLIAMS, Christine Louise m on 24.05.1951 to BURBURY, Duncan Edward
  (Kirsty)
  b 02.09.1928
  b 11.05.1914 d 26.11.1988
  Christine b. at Gisborne and m. at Tokomaru Bay. Duncan, slo Edward Percy
  Harold Burbury and Amy Leslie Rutherford, b. at Christchurch, d, at Taradale,
  cremated and ashes bd. at Havelock North. Address: 5 Simla Avenue, Havelock
  North.
  Kirsty was educated by Correspondence School and at Woodford House. She
  trained as a Karitane nurse. After marriage she became involved in community
  work and at varying times served on school committees, Waiapu House for the Elderly (committee),
  Community Arts Council (secretary), Musica Viva (secretary) and Association of NZ Embroiderer's Guilds
  (regional representative). She served on St Luke's Church vestry, taught Sunday school and Bible in
  schools, was secretary to Family Fellowship and leader of the Missionary Guild in the parish. She is
  currently an accredited visitor for Age Concern. She is a foundation member and past president of the
  Hawkes Bay Embroiderer's Guild and has been made a life member. She tutors at workshops for Embroidery
  Guilds throughout New Zealand. She enjoys travel, tramping and reading.
  Duncan was an orchardist. He served in the airforce in WW2.
